import React, { Component } from "react";
import { Link } from "react-router-dom";
import likeIcon from "../../../../Image/main-icon-like.svg";
import viewIcon from "../../../../Image/main-icon-view.svg";
import commentIcon from "../../../../Image/main-icon-comment.svg";
import "./index.scss";

export default class View extends Component {
  render() {
    const { project } = this.props;
    return (
      <Link className="challenge__project__item" to={`?pId=${project.pId}`}>
        <img 
          className="challenge__project__item__thumbnail-image"
          src={project.published.icon}
          alt="work thumbnail"
        />
        <p className="challenge__project__item__title">{project.published.name}</p>
        <div className="challenge__project__item__user">
          <img src={project.published.user.icon} alt="" />
          <p className="challenge__project__item__name">
            {project.published.user.name}
          </p>
        </div>
        <div className="challenge__project__item__info-wrapper">
          <div className="challenge__project__item__info info--like">
            <img src={likeIcon} alt="like"/>
            {project.published.likeCount}
          </div>
          <div className="challenge__project__item__info info--view">
            <img src={viewIcon} alt="view"/>
            {project.published.viewCount}
          </div>
          <div className="challenge__project__item__info info--comment">
            <img src={commentIcon} alt="comment"/>
            {project.published.commentCount}
          </div>
        </div>
      </Link>
    )
  }
}
